var deoTestimonialsSlider=function($scope,$){var slider=$('.deo-testimonials-slider');var settings=slider.data('slider-settings');if(slider.length>0){var swiper=new Swiper('.deo-testimonials-slider',settings);}
if(elementorFrontend.isEditMode()){elementor.channels.editor.on('change',function(view){let changed=view.container.settings.changed;if(changed.dots_top_space){swiper.update();}
if(changed.space_between){settings.spaceBetween=+changed.space_between.size;swiper.destroy();swiper=new Swiper('.deo-testimonials-slider',settings);}});}}
var deoImagesSlider=function($scope,$){let slickSlider=$('.slick-images');if(slickSlider.length>0){slickSlider.not('.slick-initialized').slick({slidesToShow:3,slidesToScroll:2,responsive:[{breakpoint:1024,settings:{slidesToShow:2,slidesToScroll:2}},{breakpoint:480,settings:{slidesToShow:1,slidesToScroll:1}}]});}
if(elementorFrontend.isEditMode()){elementor.channels.editor.on('change',function(view){let changed=view.elementSettingsModel.changed;if(changed.slide_margin){slickSlider.slick('setPosition');}});}}
var deoCountdown=function($scope,$){let id=$scope.data('id'),$countdown=$('.deo-countdown-'+id),$endDate=$countdown.attr('data-end-date');if($countdown.length>0){$countdown.countdown($endDate,function(event){$(this).html(event.strftime(''
+'<div class="deo-countdown__item"><span class="deo-countdown__number">%D</span><label class="deo-countdown__label">Days</label></div>'
+'<div class="deo-countdown__item"><span class="deo-countdown__number">%H</span><label class="deo-countdown__label">Hours</label></div>'
+'<div class="deo-countdown__item"><span class="deo-countdown__number">%M</span><label class="deo-countdown__label">Minutes</label></div>'
+'<div class="deo-countdown__item"><span class="deo-countdown__number">%S</span><label class="deo-countdown__label">Seconds</label></div>'));});}}
var deoMagnificPopup=function($scope,$){$('.lightbox-img, .lightbox-video').magnificPopup({callbacks:{elementParse:function(item){if(item.el.context.className=='lightbox-video'){item.type='iframe';}else{item.type='image';}},},type:'image',closeBtnInside:false,fixedContentPos:false,gallery:{enabled:true},image:{titleSrc:'title',verticalFit:true}});$('.single-video-lightbox').magnificPopup({type:'iframe',closeBtnInside:true,removalDelay:500,callbacks:{beforeOpen:function(){this.st.iframe.markup=this.st.iframe.markup.replace('mfp-iframe-scaler','mfp-iframe-scaler mfp-with-anim');this.st.mainClass=this.st.el.attr('data-effect');},},fixedContentPos:false,tLoading:'Loading image #%curr%...'});}
function initMasonry(){var $grid=$('.masonry-grid').imagesLoaded(function(){$grid.masonry({itemSelector:'.masonry-item',columnWidth:'.masonry-item:not(.entry--first-post)',percentPosition:true,stagger:30,hiddenStyle:{transform:'translateY(100px)',opacity:0},visibleStyle:{transform:'translateY(0px)',opacity:1}});});}
